package dev.tonholo.awesomeapp.feature.camera.navigationimport androidx.navigation.NavControllerimport androidx.navigation.NavGraphBuilderimport androidx.navigation.compose.composableimport dev.tonholo.awesomeapp.feature.camera.CameraScreenimport dev.tonholo.awesomeapp.navigation.Destinationobject Camera : Destination {    override val route = "camera"    override fun setup(navController: NavController, builder: NavGraphBuilder) = with(builder) {        composable(Camera.route) {            CameraScreen(navController)        }    }}